import React, { useState } from 'react';
import { useQuery } from '@tanstack/react-query';
import axios from 'axios';
import { useAuth } from '../context/AuthContext';

interface UrlData {
  id: string;
  originalUrl: string;
  shortUrl: string;
  clicks: number;
  createdAt: string;
}

interface AnalyticsData {
  totalClicks: number;
  clicksByDate: Array<{
    date: string;
    count: number;
  }>;
  clicksByCountry: Array<{
    country: string;
    count: number;
  }>;
}

const Dashboard: React.FC = () => {
  const { user } = useAuth();
  const [selectedUrl, setSelectedUrl] = useState<string | null>(null);

  const { data: urls, isLoading: urlsLoading } = useQuery<UrlData[]>({
    queryKey: ['urls'],
    queryFn: async () => {
      const response = await axios.get('http://localhost:8080/api/url/all');
      return response.data;
    },
  });

  const { data: analytics, isLoading: analyticsLoading } = useQuery<AnalyticsData>({
    queryKey: ['analytics', selectedUrl],
    queryFn: async () => {
      if (!selectedUrl) return null;
      const response = await axios.get(`http://localhost:8080/api/url/analytics/${selectedUrl}`);
      return response.data;
    },
    enabled: !!selectedUrl,
  });

  return (
    <div className="max-w-7xl mx-auto">
      <h1 className="text-3xl font-bold mb-8">Dashboard</h1>
      
      <div className="grid grid-cols-1 lg:grid-cols-3 gap-8">
        {/* URL List */}
        <div className="lg:col-span-2">
          <h2 className="text-xl font-semibold mb-4">Your Shortened URLs</h2>
          {urlsLoading ? (
            <div className="animate-pulse">
              <div className="h-20 bg-gray-200 rounded mb-4"></div>
              <div className="h-20 bg-gray-200 rounded mb-4"></div>
              <div className="h-20 bg-gray-200 rounded"></div>
            </div>
          ) : (
            <div className="space-y-4">
              {urls?.map((url) => (
                <div
                  key={url.id}
                  className={`p-4 border rounded-lg cursor-pointer transition-colors ${
                    selectedUrl === url.id ? 'border-blue-500 bg-blue-50' : 'border-gray-200'
                  }`}
                  onClick={() => setSelectedUrl(url.id)}
                >
                  <div className="flex justify-between items-start">
                    <div>
                      <p className="text-sm text-gray-500">Original URL</p>
                      <p className="text-blue-600 hover:underline break-all">{url.originalUrl}</p>
                    </div>
                    <span className="text-sm text-gray-500">{url.clicks} clicks</span>
                  </div>
                  <div className="mt-2">
                    <p className="text-sm text-gray-500">Short URL</p>
                    <a
                      href={url.shortUrl}
                      target="_blank"
                      rel="noopener noreferrer"
                      className="text-blue-600 hover:underline break-all"
                    >
                      {url.shortUrl}
                    </a>
                  </div>
                </div>
              ))}
            </div>
          )}
        </div>

        {/* Analytics */}
        <div>
          <h2 className="text-xl font-semibold mb-4">Analytics</h2>
          {!selectedUrl ? (
            <div className="text-gray-500 text-center py-8">
              Select a URL to view analytics
            </div>
          ) : analyticsLoading ? (
            <div className="animate-pulse">
              <div className="h-32 bg-gray-200 rounded mb-4"></div>
              <div className="h-32 bg-gray-200 rounded"></div>
            </div>
          ) : (
            <div className="space-y-6">
              <div className="p-4 bg-white border rounded-lg">
                <h3 className="text-lg font-medium mb-2">Total Clicks</h3>
                <p className="text-3xl font-bold text-blue-600">{analytics?.totalClicks}</p>
              </div>

              <div className="p-4 bg-white border rounded-lg">
                <h3 className="text-lg font-medium mb-2">Clicks by Country</h3>
                <div className="space-y-2">
                  {analytics?.clicksByCountry.map((country) => (
                    <div key={country.country} className="flex justify-between">
                      <span>{country.country}</span>
                      <span className="font-medium">{country.count}</span>
                    </div>
                  ))}
                </div>
              </div>

              <div className="p-4 bg-white border rounded-lg">
                <h3 className="text-lg font-medium mb-2">Clicks by Date</h3>
                <div className="space-y-2">
                  {analytics?.clicksByDate.map((date) => (
                    <div key={date.date} className="flex justify-between">
                      <span>{new Date(date.date).toLocaleDateString()}</span>
                      <span className="font-medium">{date.count}</span>
                    </div>
                  ))}
                </div>
              </div>
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
